The rules:
1. Like this post
2. Tag 5 friends 
3. Share this post to your story for an extra entry 
4. Follow all accounts above ^^^

 Winner will be announced on Thursday May 11th 7pm.

❤️Goodluck little cuties❤️

****This prize must be picked up in London ON. We will not be shipping these items.
**** There are a lot of scams related to giveaways lately so once the winner has been announced they will receive a DM from @amy.leigh.cermaics for pickup information. DO NOT give out any credit card information regarding this giveaway. DO NOT click on any links sent in DM's. DO NOT fill out any "forms" sent in DM's. That's not us. We won't be asking for that.
